import axios from "axios";
import { useEffect, useState } from "react";

export const ExpensesHistory = () => {
  const [data, setData] = useState();

  const token = localStorage.getItem("token");

  useEffect(() => {
    const AsyncFetch = async () => {
      const res = await axios({
        method: "Get",
        url: "https:\\localhost:8000/expense",
        headers: {
          authorization: `Bearer ${token}`,
        },
      })
        .then((res) => {
          console.log("Get All Expenses Resp ===", res);
          setData(res.data);
        })
        .catch((error) => {
          console.log("Get All Expense Error", error);
        });
    };

    AsyncFetch();
  }, []);

  return (
    <>
      <div className="text-center">
        <ul className="m-0 p-0">
                <li className="row  p-3  my-2">
                  <p className="col fw-bold">Expense</p>
                  <p className="col fw-bold">Price</p>
                </li>
          {data &&
            data.map((result) => {
              return (
                <li className="row  p-1  my-2">
                  <span className="col ms-5" style={{textAlign:'left'}}>{result.title}</span>
                  <span className="col">{result.price}</span>
                </li>
              );
            })}
        </ul>
      </div>
    </>
  );
};
